import {Link} from 'react-router-dom'

const LanguagesPage = () => {


    const loadLanguages = () => {
        
        fetch('http://localhost:5005/api/languages')
            .then(res => res.json())
            .then(allLanguages => console.log(allLanguages))
    }

    loadLanguages()

    return (
        <main>
            <h1>Esta es la lista</h1>
            <hr />
            <Link to="/">Inicio</Link>

        </main>
    )
}

export default LanguagesPage
